import React from "react";
import Wrapper from "../components/Wrapper";
import UsersProfile from "../components/UsersProfile";
import ProfileTitle from "../ProfileTitle";

function Profile() {
    return (
        <div>
            <ProfileTitle/>
            <Wrapper>
                <UsersProfile />
            </Wrapper>
        </div >
    );
}

export default Profile;
